  "title": {
    "nb": "Arealressurskart - AR50 - Skogbonitet"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR250 som viser produksjonsevne/ bonitet i skogareal i målestokk 1:50 000 og er tilpasset bruk i målestokker fra 1:20 000 til 1:100 000. Skogbonitet er et mål for arealets evne til å produsere trevirke. Egenskap i datasettet som skal brukes til å fremstille kartlaget heter ARSKOGBON. AR50 fremstilles ved en generalisering av FKB-AR5 under tregrensa og tolking av satellittbilder over tregrensa. I tillegg har det vært benyttet N50 der det verken finnes AR5 eller satellittbilder. Figurer som er mindre enn 15 dekar, vises ikke på kartet, men blir slått sammen med tilgrensende områder. Datasettet oppdateres en gang hvert tredje år med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Siste oppdatering har data fra 31.12.2016. Data lastes ned som fylkesvise eller kommunevise filer."
  },
