  "description": {
    "nb": "Landsdekkende datasett som viser alle kjørbare veger som er lengre enn 50 meter og gang- og sykkelveger. Datasettet inneholder vegnett og restriksjoner, representert henholdsvis som senterlinje- og punktgeometri, med adresseinformasjon. Datasettet har høy grad av nettverkstopologi og kan for eksempel brukes til samfunnsplanlegging, beredskap, adressering, vedlikehold, presentasjon og generell oversikt. Vbase er tematisert etter vegtyper og attributter. Leveranse består av fylkes- og kommunevise filer."
