  "description": {
    "nb": "Kartverket kartlegger universell utforming og tilgjengelighet i byer og tettsteder og offentliggjør alle registrerte data. Kartleggingen viser hvordan stedet er utformet med tanke på fremkommelighet for personer med nedsatt bevegelighet og nedsatt syn. Datasettet er et bidrag til å skape bedre folkehelse og å sikre selvstendighet og sikkerhet for alle mennesker med nedsatt funksjonsevne. Målet med nasjonal kartleggingen er å sikre en enhetlig registrering av tettsteder over hele landet."
  },
