  "title": {
    "nb": "Forsvarets snøskreddata"
  },
  "description": {
    "nb": "«Forsvarets digitale snøskredoverlegg» viser områder der det kan gå snøskred. Alle områdene er samlet i en database hvor kartlagt flater enten vises som «utløsningsområde for skred» (sone 1) eller som «utløpsområde for skred» (sone 2). I sone 1 er terrenget bratt nok til at et skred kan bli utløst. Enkelte bratte områder kan være utelatt i databasen fordi skogen er så tett at muligheten for skred anses liten. Sone 2 er terrenget som ligger nedenfor utløsningsområdene og som kan nås av skred. Kartet gir ikke informasjon om hvor ofte skred forekommer. I enkelte områder går det årvisse skred, mens det på andre steder kan gå mange år mellom hver gang skred utløses. Det kan også forekomme skred fra mindre heng som ikke er angitt i databasen. \n\nDet er viktig å understreke at trygg ferdsel må alltid basere seg på vurderinger gjort på stedet og ikke kan ikke gjøres på bakgrunn av snøskredkart alene"
  },
