  "title": {
    "nb": "Matrikkelen - Bygningspunkt"
  },
  "description": {
    "nb": "Datasettet Matrikkelen-Bygningspunkt inneholder et lite utdrag av bygningsinformasjonen som er registrert i Matrikkelen, Norges offisielle register over fast eiendom, herunder bygninger.\nDatasettet inneholder representasjonspunkt, bygningstype, bygningsnummer som er bygningens identifikasjon uavhengig av system, nåværende status, koblingsnøkkel mot Riksantikvarens registre og bygningstype.\n\nUtgåtte bygninger er ikke med, - heller ikke bygningsendringer som påbygg, tilbygg.\n\nDistribusjoner er satt opp mot en distribusjonsløsning som baserer seg på endringslogg-tjeneste fra Matrikkelsystemet. De ulike distribusjonene har ulik oppdateringsfrekvens, fra 15 minutters forsinkelse på WFS og nedlasting av fritt valgt område fra kart, daglig for kommunevise filer og ukentlig for fylkes- og lands-filer. Ved større endringer/lastinger kan forsinkelse bli lenger."
  },
  "descriptionFormatted": {
