  "title": {
    "nb": "Jordsmonn - Dyrkingsklasse for nedbørsbasert korndyrking"
  },
  "description": {
    "nb": "Kommunvise kartlag i datasettet Jordsmonn som viser arealenes potensial for dyrking av korn uten bruk av kunstig vanning. Arealfigurer etter jordtype. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter DK_KORN_N."
  },
