  "title": {
    "nb": "Hav og is; Globale sjøisprodukter (analyser fra satelittdata)"
  },
  "description": {
    "nb": "Viser data om sjøis med mer for Arktiske og Antarktiske havområder. Produktene er globalt og automatisk generert og er produsert . Baserer seg på satellittdata fra passive mikrobølgesatellitter og leveres daglig i en horisontal oppløsning på 10 km i en polarstereografisk projeksjon.\n\nProduktet er utarbeidet som del av EUMETSAT prosjektet Ocean and Sea Ice Satellite Application Facility (OSI SAF) der hovedfokus er å utarbeide globale sjøisprodukter basert på operasjonelle satellitter. Produktene brukes blant annet av vær- og havmodeller, for miljøstudier og for overvåkning av sjøis. OSI SAF prosjektet fokuserer på høy kvalitet og validerte produkter som er fritt tilgjengelig for brukerne."
  },
  "descriptionFormatted": {
