  "title": {
    "nb": "Inngrepsfri natur i Norge"
  },
  "description": {
    "nb": "Datasettet viser hvilke områder i Norge (unntatt Svalbard og Jan Mayen) som ikke er berørt av tyngre tekniske inngrep. Inngrepsfri natur er områder som ligger en kilometer eller mer i luftlinje unna tyngre tekniske inngrep så som veier, større kraftlinjer, jernbane, vassdragsinngrep m.fl. Dataene som danner grunnlaget for kartene er hentet fra en rekke nasjonale registre, bl.a. fra NVE, Statnett og Statens kartverk. Datasettet viser også hvilke områder som har fått endret status som følge av nye inngrep i perioden 2013-2018. Inngrepsfrie naturområder er en etablert arealbruks-indikator som viser status og utviklingstrekk for store sammenhengende naturområder i Norge. \n\nUtvikling i areal av inngrepsfrie naturområder er også en av åtte indikatorer under nasjonalt miljømål 1.1 Naturmangfold: \"Økosystemene skal ha god tilstand og levere økosystemtjenester."
  },
